from base import run_test
import time
from urllib.request import urlopen


def api(url, base_thread):
    start = time.time() - base_thread
    try:
        urlopen(url)
    except Exception as e:
        print('ERROR: %s' % e)
    stop = time.time() - base_thread
    return start, stop


url = "data:image/jpeg;base64,"
urls = [url] * 500

run_test(api, urls)
